import { useContext, useEffect } from "react";
import { ApiContext } from "../../context/ApiContext";
import { Link } from "react-router-dom";
import { ScriptsContext } from "../../context/ScriptsContext";

const JobsMenu = () => {
  const { allJobs } = useContext(ApiContext);
  const { searchBar } = useContext(ScriptsContext);
  return (
    <div className="pr-3">
      {allJobs
        ? allJobs.map((job, i) => {
            if (
              searchBar !== "" ||
              job.description.toLowerCase().includes(searchBar.toLowerCase()) ||
              job.title.toLowerCase().includes(searchBar.toLowerCase()) ||
              job.payment_method
                .split("'")[1]
                .toLowerCase()
                .includes(searchBar.toLowerCase())
            ) {
              const searchList = searchBar.toLowerCase().split(" ");
              for (const textS of searchList){
                if (job.description.toLowerCase().includes(textS) ||
                job.title.toLowerCase().includes(textS) ||
                job.payment_method
                  .split("'")[1]
                  .toLowerCase()
                  .includes(textS)){
                    return (
                      <Link href="#" key={i} to={`/job/${job.id}`}>
                        <div className="flex flex-row mt-10">
                          <div className="flex items-center group hover:cursor-pointer">
                            <div className="basis-1/4">
                              <img src="./images/logob.png" className="h-full" />
                            </div>
                            <div className="pl-2 basis-3/4 text-sh-phlox">
                              <div className="flex justify-between items-center pb-1">
                                <p className="text-sm font-semibold capitalize">
                                  {job.title}
                                </p>
                                <p className="text-xs font-semibold capitalize">
                                  {job.payment_method.split("'")[3] +
                                    job.payment_method.split("'")[1]}
                                </p>
                              </div>
      
                              <p className="text-xs font-thin">
                                {job.description.slice(0, 110) + "..."}
                              </p>
                            </div>
                          </div>
                        </div>
                      </Link>
                    );
                }
              }
            }else{
              console.log("asd")
              return (
                <Link href="#" key={i} to={`/job/${job.id}`}>
                  <div className="flex flex-row mt-10">
                    <div className="flex items-center group hover:cursor-pointer">
                      <div className="basis-1/4">
                        <img src="./images/logob.png" className="h-full" />
                      </div>
                      <div className="pl-2 basis-3/4 text-sh-phlox">
                        <div className="flex justify-between items-center pb-1">
                          <p className="text-sm font-semibold capitalize">
                            {job.title}
                          </p>
                          <p className="text-xs font-semibold capitalize">
                            {job.payment_method.split("'")[3] +
                              job.payment_method.split("'")[1]}
                          </p>
                        </div>

                        <p className="text-xs font-thin">
                          {job.description.slice(0, 110) + "..."}
                        </p>
                      </div>
                    </div>
                  </div>
                </Link>
              );
            }
          })
        : null}
      <a href="#" id="a1">
        <div className="flex flex-row mt-10">
          <div className="flex items-center group hover:cursor-pointer">
            <div className="basis-1/4">
              <img src="./images/logob.png" className="h-full" />
            </div>
            <div className="pl-2 basis-3/4 text-sh-phlox">
              <div className="flex justify-between items-center pb-1">
                <p className="text-sm font-semibold capitalize">Job Title</p>
                <p className="text-xs font-semibold capitalize">Payment</p>
              </div>

              <p className="text-xs font-thin">Description</p>
            </div>
          </div>
        </div>
      </a>
      <a href="#">
        <div className="flex flex-row mt-10">
          <div className="flex items-center group hover:cursor-pointer">
            <div className="basis-1/4">
              <img src="./images/logob.png" className="h-full" />
            </div>
            <div className="pl-2 basis-3/4 text-sh-phlox">
              <div className="flex justify-between items-center pb-1">
                <p className="text-sm font-semibold capitalize">Job Title</p>
                <p className="text-xs font-semibold capitalize">Payment</p>
              </div>

              <p className="text-xs font-thin">
                Lorem ipsum dolor sit amet consectetur, adipisicing elit.
              </p>
            </div>
          </div>
        </div>
      </a>
    </div>
  );
};
export default JobsMenu;
